import logo from './logo.svg';
import './App.css';
import React, { useState, useEffect } from "react";

function App() {
  const [reunioes, setReunioes] = useState([]);

  useEffect(() => {
    async function fetchData() {
      console.log("here")
      try {
        const response = await fetch("https://service-aluguel-salas.onrender.com/reuniao");
        if (response.ok) {
          const data = await response.json();
          console.log("JSON recebido:", data);
          setReunioes(data);
        } else {
          console.error("Erro na resposta da solicitação GET");
        }
      } catch (error) {
        console.error("Erro ao buscar as reuniões:", error);
      }
      console.log("here3")
    }
    fetchData();
  }, []);
  console.log(reunioes)
  return (
    <div>
      <h2>Reuniões Agendadas</h2>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Loja</th>
            <th>Grau</th>
            <th>Sala</th>
            <th>Data Inicial</th>
            <th>Data Final</th>
          </tr>
        </thead>
        <tbody>
          {reunioes.map((reuniao) => (
            <tr key={reuniao.id}>
              <td>{reuniao.id}</td>
              <td>{reuniao.nome}</td>
              <td>{reuniao.loja}</td>
              <td>{reuniao.grau}</td>
              <td>{reuniao.sala}</td>
              <td>{reuniao.dataInicial}</td>
              <td>{reuniao.dataFinal}</td>
              <td><button>Cancelar</button></td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default App;
